There is a method, calculateTechnicalDebt.  I don think the calculation for Day and year are correct, the is what I see 

A day is counted as 1440 min, I think it should be 480.

Year is counted as 525600 minutes I think it should be 105,600 minutes. This is what I think it should be:
 Min              Hours          Days    Year 
 60.000              1.000       0.125   0.001 
 480.000              8.000          1.000   0.005   *assume a day == 8 hours
 105,600.000     1,760.000     220   1.000  \* assume a year is 220 workdays

I am testing the patch now...
